import React from 'react';
import { ReactComponent as MilkSvg } from '../components/Milk.svg';

const NotFound = () => (
  <div className="screen-size page center row">
    <div className=" white">
      <MilkSvg width="500px" height="500px" />
      <div className="row white center">
        <div>
          <h1>404 Page not found</h1>
          <h1>The page you are looking for is not avaiable</h1>
        </div>
      </div>
    </div>
  </div>
);

export default NotFound;
